import React from 'react';

const styles = {
  footer: {
    display: 'flex',
    flexWrap: 'wrap',
    alignItems: 'flex-end',
    height: '100%',
    background: '#dad7cd',
  }
};

export default function Footer() {
  return (
    <div style={styles.footer}>
      <h1>Footer</h1>
    </div>
  );
}
